css:
.theme-isotope-ui .tool-bar {
  border: none;
  background: rgba(255, 255, 255, 0);
}
.theme-isotope-ui .tool-bar button.tool-bar-btn {
  background: inherit;
  border-color: rgba(255, 255, 255, 0);
}
.theme-isotope-ui .tool-bar button.tool-bar-btn:focus,
.theme-isotope-ui .tool-bar button.tool-bar-btn:hover {
  border-color: rgba(255, 255, 255, 0);
  background: rgba(255, 255, 255, 0.2);
}
